/*
 * Definition:
 *     Beaufort Number 0 (calm): <<WIND_SPEED>> less than or equal to 0,5
 *     metres per second (1 knot). A <WATERBODY_SURFACE> is smooth and
 *     mirror-like. On <LAND>, <SMOKE> rises vertically.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_CALM ((EAC_Beaufort_Wind_Scale)1)

/*
 * Definition:
 *     Beaufort Number 1 (light air): <<WIND_SPEED>> greater than 0,5 and up
 *     to 1,5 metres per second (between roughly 1 and 3 knots). A
 *     <WATERBODY_SURFACE> is characterized by scale like ripples without
 *     foam crests. <<MEAN_WAVE_HEIGHT>> of 7,5 centimetres (roughly 0,25
 *     foot). On <LAND>, <SMOKE> drifts but <WIND_VANE>s do not move.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_LIGHT_AIR ((EAC_Beaufort_Wind_Scale)2)

/*
 * Definition:
 *     Beaufort Number 2 (light breeze): <<WIND_SPEED>> greater than 1,5 and
 *     up to 3,4 metres per second (between roughly 4 and 6 knots). Small,
 *     short wavelets; crests have a glassy appearance and do not break.
 *     <<MEAN_WAVE_HEIGHT>> of 15 centimetres (roughly 0,5 foot). On <LAND>,
 *     <WIND_VANE>s are affected and leaves rustle.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_LIGHT_BREEZE ((EAC_Beaufort_Wind_Scale)3)

/*
 * Definition:
 *     Beaufort Number 3 (gentle breeze): <<WIND_SPEED>> greater than 3,4 and
 *     up to 5,6 metres per second (between roughly 7 and 10 knots). Large
 *     wavelets; some crests begin to break; occasional white foam crests.
 *     <<MEAN_WAVE_HEIGHT>> of 0,3 metre (roughly 1 foot). On <LAND>, leaves
 *     and small twigs are in constant motion.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_GENTLE_BREEZE ((EAC_Beaufort_Wind_Scale)4)

/*
 * Definition:
 *     Beaufort Number 4 (moderate breeze): <<WIND_SPEED>> greater than 5,6
 *     and up to 8,3 metres per second (between roughly 11 and 16 knots).
 *     Small <WATER_WAVE>s, becoming longer; numerous whitecaps.
 *     <<MEAN_WAVE_HEIGHT>> of 1 metre (roughly 3 feet). On <LAND>, small
 *     branches move and <DUST> is raised.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_MODERATE_BREEZE ((EAC_Beaufort_Wind_Scale)5)

/*
 * Definition:
 *     Beaufort Number 5 (fresh breeze): <<WIND_SPEED>> greater than 8,3 and
 *     up to 10,9 metres per second (between roughly 17 and 21 knots).
 *     Moderate <WATER_WAVE>s, taking a more pronounced long form; many
 *     whitecaps; some spray. <<MEAN_WAVE_HEIGHT>> of 1,8 metres (roughly 6
 *     feet). On <LAND>, medium branches move and debris moves about.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_FRESH_BREEZE ((EAC_Beaufort_Wind_Scale)6)

/*
 * Definition:
 *     Beaufort Number 6 (strong breeze): <<WIND_SPEED>> greater than 10,9
 *     and up to 14,1 metres per second (between roughly 22 and 27 knots).
 *     Large <WATER_WAVE>s begin to form; white foam crests are more
 *     extensive everywhere; there may be more spray. <<MEAN_WAVE_HEIGHT>>
 *     of 3,7 metres (roughly 12 feet). On <LAND>, large branches are in
 *     motion, wires whistle, and wind can be heard in pine <TREE>s.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_STRONG_BREEZE ((EAC_Beaufort_Wind_Scale)7)

/*
 * Definition:
 *     Beaufort Number 7 (near gale): <<WIND_SPEED>> greater than 14,1 and up
 *     to 17,2 metres per second (between roughly 28 and 33 knots). A
 *     <WATERBODY_SURFACE> heaps up; white foam from breaking <WATER_WAVE>s
 *     begins to be blown in streaks along the <DIRECTION> of the <WIND>.
 *     <<MEAN_WAVE_HEIGHT>> of 4,6 metres (15 feet). On <LAND>, entire
 *     <TREE>s are in motion, walking is difficult, and a roar can be heard
 *     in pine <TREE>s.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_NEAR_GALE ((EAC_Beaufort_Wind_Scale)8)

/*
 * Definition:
 *     Beaufort Number 8 (gale): <<WIND_SPEED>> greater than 17,2 and up to
 *     20,8 metres per second (between roughly 34 and 40 knots). Moderately
 *     high <WATER_WAVE>s of greater length; edges of crests; foam is blown
 *     into well-marked streaks along the <DIRECTION> of the <WIND>.
 *     <<MEAN_WAVE_HEIGHT>> of 6 metres (roughly 20 feet). On <LAND>, twigs
 *     break off <TREE>s and lawn furniture rocks.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_GALE ((EAC_Beaufort_Wind_Scale)9)

/*
 * Definition:
 *     Beaufort Number 9 (strong gale): <<WIND_SPEED>> greater than 20,8 and
 *     up to 24,4 metres per second (between roughly 41 and 47 knots). A
 *     <WATERBODY_SURFACE> is characterized by high <WATER_WAVE>s; dense
 *     streaks of foam along the <DIRECTION> of the <WIND>; crests of
 *     <WATER_WAVE>s begin to roll over; spray may reduce visibility.
 *     <<MEAN_WAVE_HEIGHT>> of 9 metres (roughly 30 feet). On <LAND>, large
 *     branches break, lawn furniture is moved, and <MOTOR_VEHICLE>s are
 *     rocked.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_STRONG_GALE ((EAC_Beaufort_Wind_Scale)10)

/*
 * Definition:
 *     Beaufort Number 10 (storm): <<WIND_SPEED>> greater than 24,4 and up to
 *     28,4 metres per second (between roughly 48 and 55 knots). Very high
 *     <WATER_WAVE>s with long overhanging crests; foam in great patches is
 *     blown in dense white streaks along the <DIRECTION> of the <WIND>;
 *     visibility is reduced. <<MEAN_WAVE_HEIGHT>> of 12 metres (roughly 40
 *     feet). On <LAND>, <TREE>s are uprooted, shingles on <ROOF>s are
 *     damaged, and <MOTOR_VEHICLE> motion is affected.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_STORM ((EAC_Beaufort_Wind_Scale)11)

/*
 * Definition:
 *     Beaufort Number 11 (violent storm): <<WIND_SPEED>> greater than 28,4
 *     and up to 32,4 metres per second (between roughly 56 and 63 knots).
 *     Exceptionally high <WATER_WAVE>s. A <WATERBODY_SURFACE> is completely
 *     covered with long, white patches of foam lying along the <DIRECTION>
 *     of the <WIND>; visibility reduced. <<MEAN_WAVE_HEIGHT>> of 15 metres
 *     (roughly 50 feet). On <LAND>, <BUILDING>s suffer structural damage,
 *     lawn furniture becomes airborne, and driving becomes difficult.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_VIOLENT_STORM ((EAC_Beaufort_Wind_Scale)12)

/*
 * Definition:
 *     Beaufort Number 12 (hurricane): <<WIND_SPEED>> greater than 32,4
 *     metres per second (64 knots). The <AIR> is filled with foam and
 *     spray. A <WATERBODY_SURFACE> is completely white with driving spray;
 *     visibility very much reduced. <<MEAN_WAVE_HEIGHT>> of 18,3 metres
 *     (roughly 60 feet) and greater. On <LAND>, <BUILDING>s suffer
 *     widespread damage, power lines are downed, <TREE>s are broken, and
 *     <MOTOR_VEHICLE>s are blown off the <ROAD>s.
 *
 * Enumerant for Attribute: BEAUFORT_WIND_SCALE
 */
#define EEC_BEAUFORTWNDSCL_HURRICANE ((EAC_Beaufort_Wind_Scale)13)


