/*
 * Definition:
 *     Centres of older <CITY>s with high concentrations of <BUILDING>s with
 *     multiple <FLOOR_LEVEL>s (5 to 50); Attached[sub(1)]. <BUILDING>s
 *     occupy nearly all of their lots and are flush to <SIDEWALK>s and they
 *     either attach or abut neighbours. Usually bordered by
 *     <<<ATTACHED_1>>> and <<<DISCRETE_CLUST_1>>> zones.
 *
 * Enumerant for Attribute: URBAN_TERRAIN_ZONE_TYPE
 */
#define EEC_URBTERZNTY_ATTACHED_1 ((EAC_Urban_Terrain_Zone_Type)1)

/*
 * Definition:
 *     <BUILDING>s fill lots to their perimeters, but are not as tall as
 *     those in <<<ATTACHED_1>>>; Attached[sub(2)]. <BUILDING>s are attached
 *     or abutted to neighbours, are flush to <STREET>s, and are typically 5
 *     to 10 <FLOOR_LEVEL>s. Land use is mainly <APARTMENT_HOUSE>s with some
 *     <HOTEL>s and offices.
 *
 * Enumerant for Attribute: URBAN_TERRAIN_ZONE_TYPE
 */
#define EEC_URBTERZNTY_ATTACHED_2 ((EAC_Urban_Terrain_Zone_Type)2)

/*
 * Definition:
 *     Attached or abutted individual <BUILDING>s (for example: row houses),
 *     typically of 1 to 4 <FLOOR_LEVEL>s and most often residential.
 *     <BUILDING>s have little or no setback from <SIDEWALK> and they
 *     usually have a narrow back yard; Attached[sub(3)].
 *
 * Enumerant for Attribute: URBAN_TERRAIN_ZONE_TYPE
 */
#define EEC_URBTERZNTY_ATTACHED_3 ((EAC_Urban_Terrain_Zone_Type)3)

/*
 * Definition:
 *     Attached or abutted <BUILDING>s, 2 to 10 <FLOOR_LEVEL>s, flush to the
 *     <STREET> with no setback or side set; Attached[sub(4)].
 *     The<BUILDING>s have industrial or storage functions with little space
 *     for parking. Non-built-upon space is primarily for storage of
 *     <MATERIAL>.
 *
 * Enumerant for Attribute: URBAN_TERRAIN_ZONE_TYPE
 */
#define EEC_URBTERZNTY_ATTACHED_4 ((EAC_Urban_Terrain_Zone_Type)4)

/*
 * Definition:
 *     Attached or abutted <BUILDING>s, along commercial ribbon <STREET>s;
 *     Attached[sub(5)]. Typically 1 to 5 <FLOOR_LEVEL>s, and old in age
 *     (newer types are typically of the <<<DISCRETE_CLUST_5>>> zone), with
 *     no setback from <SIDEWALK>s. The <BUILDING>s often have a commercial
 *     function on the ground <FLOOR>, with apartments above.
 *
 * Enumerant for Attribute: URBAN_TERRAIN_ZONE_TYPE
 */
#define EEC_URBTERZNTY_ATTACHED_5 ((EAC_Urban_Terrain_Zone_Type)5)

/*
 * Definition:
 *     Attached <BUILDING> or <BUILDING>s, 1 to 7 <FLOOR_LEVEL>s; often a
 *     single institutional <LAND> use along a <STREET> otherwise occupied
 *     by office <BUILDING>s or stores, e.g., a <CHURCH>,
 *     <GOVERNMENT_BUILDING>, or a <HOSPITAL_BUILDING>; Attached[sub(6)].
 *     This is in effect a single instance of a differing <BUILDING> rather
 *     than a zone of multiple <BUILDING>s.
 *
 * Enumerant for Attribute: URBAN_TERRAIN_ZONE_TYPE
 */
#define EEC_URBTERZNTY_ATTACHED_6 ((EAC_Urban_Terrain_Zone_Type)6)

